"     </a>",
"     )",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H21\">",
"     <span class=\"h2\">",
"      Patient support",
"     </span>",
"     &nbsp;&mdash;&nbsp;There are a number of online forums where patients can find information and support from other people with similar conditions.",
"    </p>",
"    <p>",
"     <ul class=\"bullet-block\">",
"      <li>",
"       <a class=\"external\" href=\"file://about.com/\">",
"        About.com",
"       </a>",
"       Cancer Forum",
"      </li>",
"     </ul>",
"    </p>",
