"         <li class=\"plainItem\">",
"          <a href=\"#H23544809\">",
"           SURGICAL APPROACH TO ENDOMETRIAL CANCER",
"          </a>",
"         </li>",
"         <li class=\"plainItem\">",
"          <a href=\"#H28379987\">",
"           DEFINING RISK IN ENDOMETRIAL CANCER",
"          </a>",
"         </li>",
"         <li class=\"plainItem\">",
