var title_f8_12_8396="Features of Mansonella spp I";
var content_f8_12_8396=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F66052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F66052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features of mansonella species causing human infection - I",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. streptocera",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. ozzardi",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. perstans",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Geographic distribution",
"       </td>",
"       <td>",
"        Western and Central Africa",
"       </td>",
"       <td>",
"        Central and South America, Caribbean",
"       </td>",
"       <td>",
"        Sub-Saharan and North Africa, South America",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Transmission",
"       </td>",
"       <td>",
"        Transmitted via bite of infected Culicoides species (midge)",
"       </td>",
"       <td>",
"        Transmitted via bite of infected Culicoides species (midge) or by Simulium amazonicum (black fly)",
"       </td>",
"       <td>",
"        Transmitted via bite of infected Culicoides species (various species)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Clinical features",
"       </td>",
"       <td>",
"        Usually asymptomatic, but can cause chronic papulonodular dermatitis, pruritis, pigmentation changes, dermal thickening, and lymphadenopathy. May be difficult to distinguish from onchocerciasis.",
"       </td>",
"       <td>",
"        Usually asymptomatic, but can be associated with urticaria, pruritic rash, edema, lymphadenopathy, arthralgias, fever, headache, vertigo, or pulmonary symptoms.",
"       </td>",
"       <td>",
"        Usually asymptomatic, but can cause transient angioedema, urticaria, and pruritus, and may be difficult to distinguish from loiasis. Other manifestations include headache, arthralgias, pericarditis, pleuritis, hepatitis, meningoencephalitis, and ocular symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Site of adult parasites",
"       </td>",
"       <td>",
"        Dermal layers of the trunk and upper shoulder girdle",
"       </td>",
"       <td>",
"        Lymphatics and thoracic and peritoneal cavities",
"       </td>",
"       <td>",
"        Pericardial, pleural and peritoneal cavities; mesenteric, perirenal, and retroperitoneal tissues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Site of microfilariae",
"       </td>",
"       <td>",
"        Blood",
"       </td>",
"       <td>",
"        Blood and skin",
"       </td>",
"       <td>",
"        Skin",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
