var title_f8_12_8397="Etiology of chorea";
var content_f8_12_8397=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F79166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F79166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiology of chorea",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        1. Developmental/aging choreas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physiological chorea of infancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cerebral palsy - anoxic, kernicterus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Minimal cerebral dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Buccal-oral-lingual dyskinesia and edentulous orodyskinesia in elderly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Senile chorea (probably several causes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        2. Hereditary choreas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Huntington's disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Benign hereditary chorea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuroacanthocytosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other CNS \"degenerations\": OPCAs, Azorean disease, ataxia telangiectasia, tuberous sclerosis, Hallervorden-Spatz, Dentato-rubral-pallido-luysian atrophy (DRPLA), familial calcification of basal ganglia, others",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurometabolic disorders: Wilson disease, Lesch Nyhan, lysosomal storage disorders, amino acid disorders, Leigh, porphyria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        3. Drug induced",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Neuroleptics (tardive dyskinesia), antiparkinsonian drugs, amphetamines, tricyclics, oralcontraceptives, anticonvulsants, anticholinergics, others",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        4. Toxins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        5. Metabolic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperthyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypoparathyroidism (various types)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pregnancy (Chorea Gravidarum)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyper and hyponatremia, hypomagnesemia, hypocalcemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypo and hyperglycemia (latter may cause hemichorea, hemiballism)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acquired hepatocerebral degeneration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nutritional (eg, beriberi, pellagra, B12 deficiency in infants)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        6. Infectious",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sydenham's chorea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Encephalitis lethargica",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Various other infections and postinfectious encephalitides, including Creutzfeldt-Jakob disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        7. Immunological",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SLE (including ANF negative cases with lupus anticoagulant)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Henoch-Schonlein",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Others rarely: Sarcoid, MS, Behcet's, polyarteritis nodosa, myeloproliferative disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        8. Vascular (often hemichorea)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infarction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AVM",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polycythemia rubra vera",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Migraine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        9. Tumors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        10.Trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Including subdural and epidural hematoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        11. Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Including paroxysmal choreoathetosis",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Jankovic, J, Lang, AE. Classification of movement disorders. In: Germano, IM, (Ed), Surgical Treatment of Movement Disorders, The American Association of Neurological Surgeons (AANS), Lebanon, NH, 1998. p.3.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
